t.add("welcome.add_loyalty_cards.desc_v2", "En AwardWallet no solo nos importan los viajes; aunque esperamos que uses AwardWallet para controlar tus millas en programas de fidelizaci\u00f3n y puntos de hoteles, simplemente nos apasiona cualquier tipo de recompensa. Tambi\u00e9n trabajamos con programas de compras como Starbucks y Best Buy adem\u00e1s de otros programas asociados a diferentes entidades bancarias; en total, trabajamos con 700 programas. Entra en el enlace %link1_on%para ver todos los programas con los que trabajamos %link1_off%. %status%\u00bfEst\u00e1s preocupado por la seguridad? Nosotros tambi\u00e9n. No nos la jugamos cuando se trata de nuestros miembros y de sus recompensas. Aqu\u00ed tienes nuestra declaraci\u00f3n sobre seguridad: %link2%. Te recomendamos que tambi\u00e9n consideres habilitar la autenticaci\u00f3n en dos pasos %link3_on% %link3_off% para a\u00f1adir m\u00e1s seguridad a tu cuenta.", "email", "es");
t.add("welcome.blog", "Hemos creado un blog para escribir contenido sobre puntos y millas %link1_on% y poder envi\u00e1rtelo todos los d\u00edas %link1_off%. Hablamos de todo un poco, desde las noticias m\u00e1s relevantes hasta consejos sobre c\u00f3mo sacarle el m\u00e1ximo partido a tus puntos y millas.", "email", "es");
t.add("welcome.book_reward_tickets.desc_v2", "\u00bfEst\u00e1s preparado para viajar pero tienes dificultades para canjear las millas o puntos que tanto te ha costado reunir? \u00a1Nuestro equipo est\u00e1 dispuesto a ayudarte! Dinos d\u00f3nde quieres ir enviando una solicitud de reserva: %link%. Usaremos de la mejor forma tus puntos y reservaremos tus billetes por ti.", "email", "es");
t.add("welcome.book_reward_tickets_v2", "Canjear puntos y Millas", "email", "es");
t.add("welcome.choose_cc.desc_v2", "Si te tomas en serio lo de conseguir puntos y millas, debes conocer las %link1_on%mejores tarjetas de fidelizaci\u00f3n%link1_off% disponibles hoy en el mercado. Las tarjetas de fidelizaci\u00f3n son clave para aumentar tu saldo de puntos o millas. Nuestra opci\u00f3n favorita %link2_on%es una tarjeta de cr\u00e9dito muy flexible con recompensas de viajes%link2_off% , que te permite canjear tus puntos en met\u00e1lico o usarlos en las compa\u00f1\u00edas a\u00e9reas y hoteles asociados.", "email", "es");
