t.add("welcome.organize_trips.desc_v2", "\u00bfQuieres tener un solo lugar para todos tus itinerarios de viajes? Lo tenemos. AwardWallet puede obtener todos los detalles de tus viajes de distintos proveedores, como compa\u00f1\u00edas a\u00e9reas, hoteles, empresas de alquiler de veh\u00edculos o restaurantes, y ordenarlos en una cronolog\u00eda \u00fanica y f\u00e1cil de usar. Puedes importar tus viajes obteni\u00e9ndolos de tus cuentas de fidelizaci\u00f3n: %link% o enviarlos por e-mail a tu bandeja de entrada personalizada en AwardWallet %email%.", "email", "es");
