t.add("answer.24", "S\u00ed. Tu informaci\u00f3n no se eliminar\u00e1, simplemente bajar\u00e1s de nivel y tendr\u00e1s la opci\u00f3n de volver a subir de nivel si as\u00ed lo deseas.", "faq", "es");
t.add("answer.27", "<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/27-1.png\" style=\"width: 650px; height: 59px;\" \/> <p style=\"line-height:1.5\">1. Indica que el saldo ha cambiado en las \u00faltimas 24 horas<br \/> 2. Casilla para seleccionar esta cuenta y otras opciones<br \/> 3. Muestra m\u00e1s informaci\u00f3n sobre la cuenta<br \/> 4. Inicio de sesi\u00f3n autom\u00e1tico est\u00e1 desactivado para esta cuenta<br \/> 5.\u00a0Icono del proveedor asociado<br \/> 6. Progreso del nivel Elite del socio<br \/> 7. Nombre de usuario empleado para iniciar sesi\u00f3n en esta cuenta<br \/> 8. N\u00famero de cuenta<br \/> 9. Indica que la contrase\u00f1a de esta cuenta est\u00e1 almacenada localmente en el navegador<br \/> 10. Nivel Elite actual en el programa<br \/> 11. Progreso del nivel Elite<br \/> 12. Saldo de la cuenta<br \/> 13. La actualizaci\u00f3n en segundo plano est\u00e1 desactivada por motivos t\u00e9cnicos<br \/> 14. Muestra la entrada personalizada y el saldo no se actualiza autom\u00e1ticamente<br \/> 15. Valor del cambio del \u00faltimo saldo<br \/> 16. Muestra si el \u00faltimo cambio del saldo fue positivo o negativo<br \/> 17. Progreso del objetivo marcado<br \/> 18. Fecha de caducidad del saldo<br \/> 19. Muestra que se ha calculado la fecha de caducidad del saldo<\/p>", "faq", "es");
t.add("answer.28", "Si invitas a otros usuarios y estos se registran en AwardWallet, podr\u00e1s subir de nivel de forma gratuita por cada 5 personas registradas, y eso no es todo. Si <a href=\"\/agent\/invites.php\">alguna de las personas a las que has invitado<\/a> se abona a una cuenta AwardWallet Plus, obtendr\u00e1s puntos adicionales en proporci\u00f3n a su contribuci\u00f3n. Si las personas a las que has invitado no se abonan a la cuenta AwardWallet Plus, entonces no obtendr\u00e1s ning\u00fan punto. Cuando alcances <a href=\"\/agent\/redeem.php\">ciertas metas<\/a>, transformaremos esos puntos en puntos\/millas de tu programa favorito y los depositaremos en tu cuenta de ese programa. Para m\u00e1s informaci\u00f3n, consulta esta recomendaci\u00f3n:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/<\/a>", "faq", "es");
t.add("answer.29", "<a href=\"https:\/\/business.awardwallet.com\/\">La interfaz de AwardWallet Business<\/a> est\u00e1 dise\u00f1ada para clientes empresariales, mientras que AwardWallet.com ha sido pensada para personas que desean hacer un seguimiento de sus programas de fidelizaci\u00f3n y los de sus familiares. A trav\u00e9s de la interfaz puedes: <ol class=\"counter-list\"> <li>Gestionar solicitudes de reserva con puntos para tus usuarios (se necesita una configuraci\u00f3n adicional para habilitar esta funci\u00f3n).<\/li> <li>Controlar programas corporativos de fidelizaci\u00f3n, como EasyBiz de Alaska Airlines o BlueBiz de KLM.<\/li> <li>Tener numerosos usuarios vinculados a tu perfil. Mientras que la interfaz b\u00e1sica Awardwallet.com no est\u00e1 dise\u00f1ada para mantener cientos de miles de cuentas vinculadas, la interfaz empresarial est\u00e1 dise\u00f1ada precisamente para eso. Puedes vincular una cuenta empresarial con los viajeros que utilizan la interfaz b\u00e1sica AwardWallet y ellos pueden escoger qu\u00e9 informaci\u00f3n compartir con tu cuenta empresarial.&nbsp;Por ejemplo, los viajeros pueden escoger compartir \u00fanicamente los n\u00fameros de sus cuentas de fidelizaci\u00f3n o pueden permitir que la cuenta empresarial&nbsp;administre por completo y supervise sus cuentas de fidelizaci\u00f3n.<\/li> <li>La interfaz empresarial viene te permite hacer un seguimiento de tus itinerarios individuales.<\/li><li>La interfaz empresarial viene con una <a href=\"https:\/\/awardwallet.com\/api\/account\">interfaz para aplicaciones que te permite recopilar la informaci\u00f3n gracias a una aplicaci\u00f3n<\/a>.&nbsp;<\/li><\/ol>", "faq", "es");
t.add("answer.30", "Esta funci\u00f3n solo est\u00e1 disponible en las cuentas empresariales (<a href=\"https:\/\/business.AwardWallet.com\">https:\/\/business.AwardWallet.com<\/a>). Si tienes una cuenta AwardWallet Business, puedes programar la exportaci\u00f3n de tus cuentas de la forma que se indica en nuestra documentaci\u00f3n API:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/api\/account\">https:\/\/awardwallet.com\/api\/account<\/a>", "faq", "es");
t.add("answer.31", "<div class=\"flex\" style=\"-webkit-align-items: flex-start;\n    -ms-align-items: flex-start;\n    align-items: flex-start;\"> <div class=\"flex__info\"> <p>AwardWallet OneCard es una tarjeta de pl\u00e1stico del tama\u00f1o de una tarjeta de cr\u00e9dito con una banda magn\u00e9tica, que te permite hacer el check in de tus vuelos en los kioskos electr\u00f3nicos del aeropuerto. La tarjeta mostrar\u00e1 tu n\u00famero de cuenta personal y tu n\u00famero de tel\u00e9fono impresos en ambos lados. La tarjeta puede tener hasta 30 cuentas de programas de fidelizaci\u00f3n distintas. Tenemos dos tipos de tarjeta: dorada y plateada. Los miembros de AwardWallet con m\u00e1s de 1 mill\u00f3n de millas y puntos obtienen una tarjeta dorada y aquellos con menos de 1 mill\u00f3n de millas y puntos obtendr\u00e1n una plateada. Las tarjetas se enviar\u00e1n a todo el mundo y tambi\u00e9n dentro de los Estados Unidos a trav\u00e9s del servicio de correos ordinario de EE. UU.<\/p> <br> <p>OneCard tiene un coste fijo de 10 $ con env\u00edo gratuito a cualquier lugar del mundo. &nbsp;Podr\u00e1s encontrar m\u00e1s informaci\u00f3n <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/30-awardwallet-onecard\/\">aqu\u00ed<\/a>.<\/p> <br> <\/div> <div class=\"flex__image\"><a href=\"#\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/Image\/OneCardSmall.png\" style=\"margin-left: 20px; width: 283px; height: 182px;\" \/><\/a><\/div> <\/div>", "faq", "es");
t.add("answer.32", "No. AwardWallet OneCard no almacena ninguna de tus contrase\u00f1as, por lo que si pierdes tu tarjeta, solo pierdes tus n\u00fameros de cuenta, no las contrase\u00f1as.", "faq", "es");
t.add("answer.33", "No. AwardWallet es completamente independiente de los hoteles, aerol\u00edneas o tarjetas de cr\u00e9dito indicados aqu\u00ed, as\u00ed como de los programas de fidelizaci\u00f3n que puedes controlar utilizando nuestros servicios.", "faq", "es");
t.add("answer.34", "\u00a1S\u00ed! Puedes leer el siguiente comunicado de prensa sobre esto:<br \/> <br \/> <a href=\"http:\/\/news.aa.com\/news\/news-details\/2013\/American-Airlines-and-AwardWallet-Offer-New-Reward-Tracking-Technology-for-AAdvantage-Members\/default.aspx\">http:\/\/news.aa.com\/news\/news-details\/2013\/American-Airlines-and-AwardWallet-Offer-New-Reward-Tracking-Technology-for-AAdvantage-Members\/default.aspx<\/a>", "faq", "es");
t.add("answer.35", "Puedes registrar una cuenta Business desde cero en:<br \/> <br \/> <a href=\"https:\/\/business.awardwallet.com\/?Register=1\">https:\/\/business.awardwallet.com\/?Register=1<\/a><br \/> <br \/> O si tienes una cuenta personal en AwardWallet, puedes crear una cuenta Business vinculada a tu cuenta personal para poder utilizar los mismos datos de conexi\u00f3n para iniciar sesi\u00f3n en la cuenta Business y en tu cuenta personal. Para ello, debes seguir este enlace:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/user\/create-business-account\">https:\/\/awardwallet.com\/user\/create-business-account<\/a>", "faq", "es");
t.add("answer.36", "El precio es 2,50 $ al mes por miembro gestionado.", "faq", "es");
t.add("answer.37", "M\u00e1s o menos. En primer lugar, con la versi\u00f3n gratuita puedes hacer clic en \"Editar\" junto a cualquier programa para ver su fecha de caducidad (incluso si est\u00e1 oculta en la lista de vistas). As\u00ed que est\u00e1 literalmente a un solo clic. En segundo lugar, puedes desagrupar tus programas (en el bot\u00f3n \"Vistas\", en la esquina superior derecha) y, a continuaci\u00f3n, \"Desagrupar cuentas\" (lista simple) y ordenar tus programas por fecha de caducidad, nombre del programa o saldo (tanto en orden ascendente como descendente). Ya que siempre mostramos las 3 primeras fechas de caducidad, al reordenar tus programas puedes controlar qu\u00e9 fechas de caducidad est\u00e1n visibles.", "faq", "es");
t.add("answer.39", "En primer lugar, debes tener derechos de administraci\u00f3n en tu ordenador para instalar esta extensi\u00f3n, es decir, debes poder instalar otros programas en tu ordenador. Si has realizado el proceso de instalaci\u00f3n de la extensi\u00f3n pero AwardWallet sigue dici\u00e9ndote que la extensi\u00f3n no est\u00e1 instalada, debes comprobar dos cosas: <ol class=\"counter-list\"> <li>Aseg\u00farate de que la instalaci\u00f3n est\u00e9 habilitada. Aqu\u00ed tienes unas capturas de pantalla que pueden ayudarte:<br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-1.png\" style=\"width: 675px; height: 427px;\" \/><br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-2.png\" style=\"width: 741px; height: 450px;\" \/><\/li> <li>Aseg\u00farate de reiniciar completamente Internet Explorer <span class=\"bold\">despu\u00e9s de<\/span> habilitar la extensi\u00f3n. En la mayor\u00eda de los casos, basta con cerrar todas las ventanas del explorador, pero a veces es necesario reiniciar el ordenador.&nbsp;<\/li> <\/ol> <br \/> Si estos pasos no funcionan, puedes intentar desinstalar la extensi\u00f3n y volver a instalarla desde el principio. As\u00ed es como se desinstala la extensi\u00f3n:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-3.png\" style=\"width: 780px; height: 526px;\" \/><br \/> <br \/>\n<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-4.png\" style=\"width: 780px; height: 480px;\" \/>", "faq", "es");
t.add("answer.40", "<ul> <li>Haz clic en la peque\u00f1a flecha junto al apartado \"Otros calendarios\" y selecciona \"A\u00f1adir por URL\":<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/40-1.png\" style=\"width: 737px; height: 401px;\" \/><\/li> <li>Copia y paga tu enlace iCal personal que obtuviste haciendo clic en el bot\u00f3n de <a href=\"\/trips\/?calendarImport=1\">Autoimportar calendario<\/a>:<br \/> <br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/40-2.png\" style=\"width: 440px; height: 220px;\" \/><\/li> <li>Si tu Google Calendar no se est\u00e1 actualizando por cualquier motivo con nuevos planes de viaje, a\u00f1ade la siguiente cadena al final de tu url: \"?nocache\" sin las comillas, <a href=\"https:\/\/productforums.google.com\/forum\/#!topic\/calendar\/ixQnzHmWDSk%5B1-25-false%5D\">seg\u00fan este hilo<\/a>.<\/li> <\/ul>", "faq", "es");
t.add("answer.41", "<ul> <li>Haz clic en Archivo -&gt; Nueva suscripci\u00f3n al calendario:<br \/><br \/><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-1.png\" style=\"width: 618px; height: 378px;\" \/><\/li> <li>Copia y pega tu enlace iCal personal que has obtenido haciendo clic en el bot\u00f3n&nbsp;<a href=\"\/trips\/?calendarImport=1\">Autoimportaci\u00f3n de calendario<\/a>&nbsp;:<br \/><br \/><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-2.png\" style=\"width: 604px; height: 151px;\" \/><\/li> <li>Configura los ajustes que consideres oportunos:<br \/><br \/><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-3.png\" style=\"width: 595px; height: 341px;\" \/><\/li> <\/ul> ", "faq", "es");
t.add("answer.42", "<ul> <li>Abre Microsoft Outlook y cambia a tu Calendario:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-1.png\" style=\"width: 231px; height: 257px;\" \/><\/li> <li>En la barra superior de men\u00fa, haz clic en \"Abrir calendario\" -&gt; \"Desde internet\":<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-2.png\" style=\"width: 438px; height: 214px;\" \/><\/li> <li>Copia y pega tu enlace iCal personal que has obtenido haciendo clic en el bot\u00f3n&nbsp;<a href=\"\/trips\/?calendarImport=1\">Autoimportaci\u00f3n de calendario<\/a>&nbsp;:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-3.png\" style=\"width: 455px; height: 153px;\" \/><\/li> <\/ul>", "faq", "es");
t.add("answer.43", "Te explicamos c\u00f3mo funciona: <ul> <li>Env\u00edas <a href=\"https:\/\/awardwallet.com\/awardBooking\/add\">una nueva solicitud de reserva con puntos<\/a>, que pasar\u00e1 a nuestra cola de reservas.<\/li> <li>Un miembro del equipo de reservas que colabora con AwardWallet se pondr\u00e1 en contacto contigo y trabajar\u00e9is juntos.<\/li> <li>El coste puede variar desde &nbsp;150 a 199 $&nbsp; por persona y reserva.<\/li> <\/ul> Cabe destacar que participan dos equipos: el equipo que realiza las reservas y el equipo de asistencia t\u00e9cnica de AwardWallet. El equipo de AwardWallet solo te facilita una plataforma t\u00e9cnica, una forma de gestionar tus solicitudes de reserva y de compartir de forma segura tus datos de los programas de fidelizaci\u00f3n con tu agente. El equipo de reservas hace todo el trabajo preparatorio: comprueba disponibilidad, te ofrece diversas opciones (por lo que se comunicar\u00e1 contigo antes de comprar cualquier billete), encuentra los mejores itinerarios y los m\u00e1s asequibles, realiza la reserva y gestiona los pagos. Son expertos en realizar reservas con puntos y han realizado decenas de miles de reservas para sus clientes y son muy creativos a la hora de encontrar disponibilidad. Todas las comunicaciones sobre la solicitud de reserva se realizan a trav\u00e9s del sitio web de AwardWallet, en el que puedes gestionar tus solicitudes y comunicarte con tu agente de reservas acerca de tus solicitudes. As\u00ed que si tienes alguna duda sobre una solicitud de reserva, no debes enviarla al servicio de asistencia de AwardWallet, ya que no podremos ayudarte. En lugar de eso, debes iniciar sesi\u00f3n en tu cuenta y responder a <a href=\"https:\/\/awardwallet.com\/awardBooking\/requests?archive=1\">tu solicitud de reserva existente<\/a>&nbsp;o bien crear una nueva solicitud de reserva:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/awardBooking\/add\">https:\/\/awardwallet.com\/awardBooking\/add<\/a><br \/> <br \/> Para m\u00e1s detalles, \u00e9chale un vistazo a este consejo:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/23-award-booking-service\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/23-award-booking-service\/<\/a>\n", "faq", "es");
t.add("answer.44", "S\u00ed, puedes habilitar la autenticaci\u00f3n en dos fases en tu perfil, lo que har\u00e1 que tu perfil de AwardWallet sea mucho m\u00e1s seguro. A gran escala, esto significa que utilizar\u00e1s tu tel\u00e9fono para generar un c\u00f3digo \u00fanico adem\u00e1s de tu nombre de usuario y tu contrase\u00f1a para iniciar sesi\u00f3n en AwardWallet. &nbsp;Si no sabes qu\u00e9 es la autenticaci\u00f3n en dos fases, puedes leer el siguiente <a href=\"https:\/\/en.wikipedia.org\/wiki\/Two-factor_authentication\">art\u00edculo de Wikipedia<\/a> o, simplemente, <a href=\"https:\/\/www.google.com\/webhp?&amp;q=what+is+two+factor+authentication\">buscarlo en Google<\/a>.&nbsp;<br \/> <br \/>Configurar una autenticaci\u00f3n en dos fases es muy f\u00e1cil. Primero tienes que descargar la aplicaci\u00f3n Google Authenticator para tu dispositivo <a href=\"https:\/\/play.google.com\/store\/apps\/details?id=com.google.android.apps.authenticator2&amp;hl=en\">Android<\/a>, <a href=\"https:\/\/itunes.apple.com\/us\/app\/google-authenticator\/id388497605?mt=8\">iOS<\/a> o <a href=\"http:\/\/www.windowsphone.com\/en-US\/apps\/021dd79f-0598-e011-986b-78e7d1fa76f8\">Windows Phone<\/a>. A continuaci\u00f3n, debes hacer clic en \u201c<a href=\"https:\/\/awardwallet.com\/user\/edit.php\">Configurar<\/a>\u201d debajo del encabezado Autenticaci\u00f3n en dos fases en tu <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">perfil de AwardWallet<\/a>. Despu\u00e9s de eso, ver\u00e1s un c\u00f3digo especial QR que tienes que escanear mediante la aplicaci\u00f3n Google Authenticator para configurarlo:<br \/> &nbsp; <div class=\"t-center\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/44.png\" style=\"width: 650px; height: 700px;\" \/><\/div> <br \/> <br \/> A continuaci\u00f3n, debes introducir el c\u00f3digo generado por la aplicaci\u00f3n en AwardWallet y habr\u00e1s terminado. Para m\u00e1s informaci\u00f3n, consulta esta recomendaci\u00f3n:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/<\/a>", "faq", "es");
t.add("answer.45", "En la interfaz web, una vez que la p\u00e1gina de tus cuentas se haya cargado por completo, empieza simplemente tecleando el nombre que deseas ver y este aparecer\u00e1. \u00c9chale un vistazo al siguiente sitio para m\u00e1s informaci\u00f3n:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/<\/a>", "faq", "es");
