t.add("answer.47", "Si tienes un monitor grande, al ampliar la anchura de tu navegador a\u00f1adir\u00e1s autom\u00e1ticamente la columna \"Actualizado por \u00faltima vez\" a tu lista de cuentas. Para ver m\u00e1s detalles, \u00e9chale un vistazo a este consejo:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/<\/a>", "faq", "es");
t.add("answer.48", "Primero, tienes que actualizar tus cuentas, luego haz clic en el s\u00edmbolo de + que hay al lado del programa y pasa a la pesta\u00f1a de \"Historial\". Las transacciones m\u00e1s recientes se mostrar\u00e1n aqu\u00ed. Para m\u00e1s detalles, \u00e9chale un vistazo a este consejo:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/<\/a>", "faq", "es");
t.add("answer.5", "No. AwardWallet no puede registrarte en un programa de fidelizaci\u00f3n ni tampoco puede a\u00f1adir millas o puntos a tus programas de fidelizaci\u00f3n. AwardWallet puede ayudarte a controlar los saldos de millas y puntos de tus programas de fidelizaci\u00f3n ya que inicia sesi\u00f3n por ti en los sitios web que tienen esas informaciones. No podemos a\u00f1adir millas o puntos a tu programa, solo el due\u00f1o del programa de fidelizaci\u00f3n puede hacerlo. Deber\u00e1s contactar con la aerol\u00ednea con la que viajaste y pedirles que a\u00f1adan las millas a tu cuenta. Despu\u00e9s, utiliza AwardWallet para controlar tus saldos de millas y puntos. AwardWallet es particularmente \u00fatil si participas en varios programas de fidelizaci\u00f3n con distintas aerol\u00edneas, hoteles, tarjetas de cr\u00e9dito, etc.", "faq", "es");
