t.add("answer.53", "S\u00ed, puedes (y deber\u00edas) hacer una copia de seguridad de tus contrase\u00f1as&nbsp;en caso de que&nbsp;hayas decidido almacenarlas de forma local. Lo puedes hacer seleccionando las cuentas de las que deseas hacer las copias y seleccionando la opci\u00f3n \"Contrase\u00f1as de copias de seguridad\" del men\u00fa \"Acciones\". &nbsp;Para m\u00e1s detalles, \u00e9chale un vistazo a esta recomendaci\u00f3n:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/<\/a>", "faq", "es");
t.add("answer.56", "S\u00ed, puedes <a href=\"https:\/\/awardwallet.com\/agents\/add-connection\">vincular tus cuentas<\/a>, y luego decidir qu\u00e9 cuentas quieres compartir con los dem\u00e1s, y qu\u00e9 nivel de acceso deseas darles. Para m\u00e1s detalles, \u00e9chale un vistazo a este consejo:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/<\/a>", "faq", "es");
t.add("answer.68", "Ante todo, \u00a1gracias! En segundo lugar, <a href=\"\/faqs#28\">s\u00ed que tenemos un programa de afiliados<\/a>, y todos nuestros logotipos y capturas de pantalla y banners est\u00e1n muy bien organizados en <a href=\"https:\/\/awardwallet.com\/media\/logos\">esta p\u00e1gina<\/a> a la que puedes acceder siempre simplemente haciendo clic con el bot\u00f3n derecho en nuestro logotipo al principio de cualquiera de las p\u00e1ginas. Para m\u00e1s detalles, \u00e9chale un vistazo a este consejo:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/<\/a>", "faq", "es");
t.add("answer.70", "Para borrar una de tus cuentas de fidelizaci\u00f3n en tu perfil de AwardWallet lo \u00fanico que tienes que hacer es&nbsp;seleccionar esa cuenta haciendo clic en la casilla que tiene al lado y luego ver\u00e1s un bot\u00f3n con un s\u00edmbolo de una papelera en el men\u00fa, y si lo pinchas, podr\u00e1s borrar todas las cuentas seleccionadas.<br \/> <br \/> <img alt=\"\" src=\"https:\/\/awardwallet.com\/images\/uploaded\/fck\/faq\/en\/70-1.png\" style=\"width: 650px; height: 383px;\" \/>", "faq", "es");
t.add("answer.71", "Primero, verifica que est\u00e1s insertando el c\u00f3digo correcto. Si no est\u00e1s seguro al 100 % del c\u00f3digo, puede que sea un problema de sincronizaci\u00f3n. Si la hora de tu ordenador es 1:00&nbsp;p.m. y la hora de tu tel\u00e9fono en el momento en el que est\u00e1s generando el c\u00f3digo es 1:03 p.m., eso indicar\u00eda un problema. En ese caso, deber\u00edas <a href=\"https:\/\/www.google.com\/search?q=how+to+sync+clock+on+android\">sincronizar&nbsp;el reloj de tu tel\u00e9fono<\/a> y volver a intentarlo.", "faq", "es");
t.add("answer.72", "Desgraciadamente, en estos momentos AwardWallet no ofrece soporte v\u00eda telef\u00f3nica, as\u00ed que no existe ning\u00fan n\u00famero al que puedas llamar para hablar con nosotros, puedes enviarnos tu pregunta a trav\u00e9s de nuestra p\u00e1gina de <a href=\"https:\/\/awardwallet.com\/contact\">Contacto<\/a> y uno de los nuestros agentes de soporte se pondr\u00e1 en contacto contigo. Normalmente respondemos a los mensajes en 1 d\u00eda \u00fatil.", "faq", "es");
t.add("answer.8", "No. AwardWallet.com ha sido dise\u00f1ada para controlar los saldos de tus programas de fidelizaci\u00f3n conect\u00e1ndose por ti en los sitios web que contienen esas informaciones. No estamos asociados a esos sitios web (por ejemplo, hilton.com, jetblue.com) de ning\u00fan modo, por lo que debes resolver cualquier problema relacionado con tu cuenta directamente con la compa\u00f1\u00eda del programa de fidelizaci\u00f3n. Por ejemplo, si no sabes c\u00f3mo conectarte al sitio web de&nbsp;hilton.com para consultar tu saldo en Hilton Honors, debes dirigirte a hilton.com y resolver este problema directamente con ellos antes de poder utilizar AwardWallet.", "faq", "es");
t.add("answer.9", "<div class=\"_counter-wrap\"><span class=\"_green-blk\">1<\/span> El motivo principal de ese error es que los datos de conexi\u00f3n no son v\u00e1lidos. Antes de que AwardWallet pueda obtener tu saldo en un programa, debes asegurarte de que puedes conectarte al sitio web de la compa\u00f1\u00eda y ver tu saldo. As\u00ed es como puedes comprobar si est\u00e1s introduciendo datos de conexi\u00f3n v\u00e1lidos: <\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">a<\/span> <div>Dir\u00edgete a AwardWallet y haz clic en el enlace \"Editar\" junto al programa correspondiente.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-1.png\" style=\"width: 400px; height: 78px;\" \/><\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">b<\/span> <div>A continuaci\u00f3n, haz clic en \"Mostrar contrase\u00f1a\" justo debajo del campo de tu contrase\u00f1a.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-2.png\" style=\"width: 396px; height: 72px;\" \/><\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">c<\/span> <div>En ese momento, te pedir\u00e1n tu contrase\u00f1a maestra de AwardWallet. Introd\u00facela y haz clic en Mostrar. &nbsp;Ahora deber\u00edas poder ver tanto tu nombre de usuario como tu contrase\u00f1a sin cifrar.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-3.png\" style=\"width: 400px; height: 238px;\" \/><\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">d<\/span> <div>Copia tu nombre de usuario y tu contrase\u00f1a y, a continuaci\u00f3n, p\u00e9galos &nbsp;(no solo vuelvas a escribirlos)&nbsp; them&nbsp;into the login input boxes on the provider website in question.<\/div> <\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">2<\/span> Si el sitio web del proveedor te hace algunas preguntas sobre tu perfil tras iniciar sesi\u00f3n, AwardWallet no podr\u00e1 comprobar tu saldo hasta que no respondas a esas preguntas.<\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">3<\/span> Si optaste por almacenar las contrase\u00f1as localmente, es posible que eliminaras cookies o cambiaras de ordenador.<\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">4<\/span> Tambi\u00e9n es posible que el sitio web de la compa\u00f1\u00eda haya cambiado y AwardWallet no lo sepa. Si ninguna de estas opciones es tu caso, <a class=\"a14pxBlue blue-link\" href=\"\/contact.php\">env\u00edanos un mensaje<\/a> y haremos todo lo posible por resolver el problema.<\/div>\n\u200b", "faq", "es");
