t.add("answer.74", "El aviso de caducidad de tu saldo controla tus cuentas de fidelizaci\u00f3n para avisarte en cuanto tu saldo cambie. Los puntos de American Express, Chase, Citi, Marriott y Capital One no siempre se publican instant\u00e1neamente cuando los transfieres a un programa de fidelizaci\u00f3n asociado.&nbsp;<br \/> <br \/> Cuando encuentres un hotel o vuelo disponible con puntos, transfiere tus puntos y luego usa este servicio para asegurarte de que puedes confirmar tu reserva antes de que te quedes sin ella. En cuanto lo tengas activado, AwardWallet comprobar\u00e1 tu cuenta a menudo y te enviar\u00e1 una notificaci\u00f3n a tu PC, m\u00f3vil o correo en cuanto se detecte un cambio.&nbsp;<br \/> <br \/> Te dejamos un v\u00eddeo explicativo que han grabado nuestros amigos de TripAstute:<br \/> &nbsp; <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/329111256\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "es");
t.add("question.74", "\u00bfQu\u00e9 son los cr\u00e9ditos del aviso de caducidad de tu saldo?", "faq", "es");
t.add("answer.75", "La herramienta <a href=\"https:\/\/awardwallet.com\/merchants\">Merchant Lookup Tool<\/a> de AwardWallet les permite a los usuarios buscar vendedores e identificar c\u00f3mo se codifican las transacciones con esos vendedores con una tarjeta de cr\u00e9dito. Esto es muy importante para maximizar el n\u00famero de puntos que ganas con una tarjeta de cr\u00e9dito espec\u00edfica.<br \/> <br \/> Algunas de las categor\u00edas m\u00e1s comunes para gastar la tarjeta de cr\u00e9dito son el supermercado, gasolina, viajes y cenas. Sin embargo, no todos los tipos de vendedores son f\u00e1ciles de clasificar. Para descubrirlo, solo tienes que buscar la tienda en cuesti\u00f3n con la Merchant Lookup Tool y&nbsp;se te mostrar\u00e1 una lista de tarjetas de cr\u00e9dito confirmadas con las que podr\u00e1s ganar 1 punto por cada d\u00f3lar que gastes en ese vendedor en particular.<br \/> <br \/> En este v\u00eddeo te lo explicamos r\u00e1pidamente:<br \/> <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/360577226\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "es");
t.add("question.75", "\u00bfQu\u00e9 es la Merchant Lookup Tool de AwardWallet?", "faq", "es");
t.add("answer.76", "AwardWallet only uses your Gmail data to retrieve travel reservations and loyalty account statements for the purposes of making the AwardWallet&#39;s service work. AwardWallet&#39;s use of information received, and AwardWallet&#39;s transfer of information to any other app, from Google APIs will adhere to Google&#39;s Limited Use Requirements. In addition to that none of your personal data that you have stored in AwardWallet is ever transmitted to any third party without your prior explicit written consent.", "faq", "es");
