t.add("pay-subscription.product.description.long", "%p_on%AwardWallet Plus es una suscripci\u00f3n basada en servicios, la duraci\u00f3n de la suscripci\u00f3n es de 1 a\u00f1o y cuando te suscribes se autorrenueva cada a\u00f1o autom\u00e1ticamente. El coste de la suscripci\u00f3n es de 30 d\u00f3lares por a\u00f1o, sin descuento por pago anticipado y de 10 d\u00f3lares por a\u00f1o con el descuento de pago anticipado. AwardWallet Plus te ofrece las siguientes funciones extra:%p_off%%list_on% %item_on%Muestra m\u00e1s propiedades extra de recompensas%item_off%%item_on%Muestra todas las fechas de caducidad de tu cuenta, para las cuentas que tienen dicha informaci\u00f3n %item_off%%item_on%Cuando actualizas tus cuentas, estas se actualizan en paralelo, hasta 5 veces m\u00e1s r\u00e1pido %item_off%%item_on%Control m\u00e1s intensivo y mejor seguimiento de tus vuelos %item_off% %list_off%%p_on%en las suscripciones AwardWallet Plus compradas desde la aplicaci\u00f3n se cargar\u00e1n en tu cuenta de iTunes y se renovar\u00e1n autom\u00e1ticamente 24 horas antes de la finalizaci\u00f3n del periodo de suscripci\u00f3n, a menos que hayas desactivado la autorrenovaci\u00f3n con anterioridad. Para gestionar tus suscripciones o desactivar la autorrenovaci\u00f3n, despu\u00e9s de la compra, accede a las configuraciones de tu cuenta en iTunes. No se emitir\u00e1 ning\u00fan tipo de reembolso despu\u00e9s de que se haya cargado la tasa de suscripci\u00f3n anual. Cualquier parte de periodo de prueba gratuito que no haya sido utilizada, se perder\u00e1 una vez que compres tu suscripci\u00f3n.%p_off%%p_on%Para m\u00e1s detalles, no dudes en revisar nuestros %link_1%T\u00e9rminos de Uso%link_off% y nuestra %link_2%Pol\u00edtica de Privacidad%link_off%.%p_off%", "mobile", "es");
