t.add("accessing_your_data.1", "Nuestros clientes siempre pueden revisar, actualizar o modificar sus datos personales desde su cuenta. Cuando as\u00ed lo desee, AwardWallet tambi\u00e9n puede informarle sobre si poseemos o procesamos en nombre de terceros alguno de sus datos personales. %link_on%P\u00f3ngase en contacto con nosotros aqu\u00ed%link_off% si necesita ayuda para revisar sus datos personales. AwardWallet responder\u00e1 a su solicitud de acceso para revisar los datos que tenemos archivados en un plazo breve de tiempo.", "privacy", "es");
t.add("accessing_your_data.2", "Si pertenece al Espacio Econ\u00f3mico Europeo, \"informaci\u00f3n personal\" se define como cualquier informaci\u00f3n personal identificable u otros datos recogidos que puedan identificarle de forma directa o indirecta. Usted puede tener derechos adicionales en virtud de sus leyes de protecci\u00f3n de datos, como los siguientes:", "privacy", "es");
t.add("accessing_your_data.2.1", "Acceso: Derecho a solicitar acceso y copia de sus datos personales;", "privacy", "es");
t.add("accessing_your_data.2.2", "Restricci\u00f3n: Puede pedirnos que restrinjamos el tratamiento de sus datos personales en determinadas circunstancias;", "privacy", "es");
t.add("accessing_your_data.2.3", "Rectificaci\u00f3n: Puede hacer que se corrija cualquier inexactitud en su informaci\u00f3n personal;", "privacy", "es");
t.add("accessing_your_data.2.4", "Supresi\u00f3n: Puede pedirnos que eliminemos su informaci\u00f3n personal en determinadas circunstancias (por ejemplo, si la informaci\u00f3n ya no es necesaria para los fines para los que se recopil\u00f3);", "privacy", "es");
t.add("accessing_your_data.2.5", "Oposici\u00f3n: Puede oponerse a que se sigan procesando sus datos personales en determinadas circunstancias;", "privacy", "es");
t.add("accessing_your_data.2.6", "Retirada del consentimiento: Cuando nos basamos en su consentimiento para procesar su informaci\u00f3n personal, usted tiene derecho a declinar el consentimiento y\/o, si lo ha dado, a retirarlo en cualquier momento. Esto no afectar\u00e1 a la legalidad del tratamiento previo a la retirada de su consentimiento.", "privacy", "es");
t.add("accessing_your_data.2.7", "Portabilidad: En determinadas circunstancias, puede solicitarnos que le facilitemos sus datos personales en un formato estructurado, de uso com\u00fan y lectura mec\u00e1nica.", "privacy", "es");
t.add("accessing_your_data.3", "Puede ejercer los derechos antes mencionados %link_on%poni\u00e9ndose en contacto con nosotros%link_off% y estudiaremos dichas solicitudes de conformidad con la legislaci\u00f3n aplicable en materia de protecci\u00f3n de datos. Podemos pedirle que verifique su identidad antes de responder a su solicitud.", "privacy", "es");
t.add("accessing_your_data.4", "Tambi\u00e9n puede tener derecho a plantear preguntas o reclamaciones a su autoridad de protecci\u00f3n de datos en cualquier momento.", "privacy", "es");
t.add("accessing_your_data.5", "Podemos transferir datos personales a empresas que nos ayudan a prestar nuestros servicios, y al hacerlo, estas transferencias a terceros est\u00e1n cubiertas por acuerdos de transferencia apropiados. Conservaremos los datos personales que procesemos en nombre de nuestro cliente seg\u00fan sea necesario para prestarle nuestros servicios. Asimismo, conservaremos esta informaci\u00f3n personal seg\u00fan sea necesario para cumplir con nuestras obligaciones legales, resolver disputas y hacer cumplir nuestros acuerdos.", "privacy", "es");
t.add("accessing_your_data.6", "AwardWallet tiene su sede en Estados Unidos. La informaci\u00f3n que recopilamos y conservamos se puede transferir a Estados Unidos o a otros pa\u00edses del mundo, o se puede controlar y procesar en ellos. Cuando nos facilita informaci\u00f3n o utiliza nuestro\/s sitio\/s web y nuestros servicios, da su consentimiento para la transferencia. Protegeremos la privacidad y seguridad de la informaci\u00f3n personal que recopilemos de acuerdo con esta pol\u00edtica de privacidad, independientemente de d\u00f3nde se procese o almacene.", "privacy", "es");
t.add("accessing_your_data.header", "Acceder a sus datos", "privacy", "es");
t.add("california_privacy_rights.header", "Ley de Privacidad del Consumidor de California", "privacy", "es");
t.add("california_privacy_rights.link", "Haga clic aqu\u00ed para leer la informaci\u00f3n adicional exigida por la Ley de Protecci\u00f3n de Datos del Consumidor de California.", "privacy", "es");
t.add("communicating.1", "Es posible que AwardWallet tenga que comunicarse con usted por diferentes motivos, como:", "privacy", "es");
t.add("communicating.1.1", "Responder a sus preguntas y solicitudes. Si se pone en contacto con nosotros para plantearnos un problema o una pregunta, utilizaremos sus datos para responderle.", "privacy", "es");
t.add("communicating.1.2", "Le enviaremos correos electr\u00f3nicos y mensajes administrativos y del Servicio. Podemos ponernos en contacto con usted para informarle sobre cambios en nuestros Servicios, nuestras ofertas de Servicios y avisos importantes relacionados con los Servicios, como avisos de seguridad y fraude. Estos correos electr\u00f3nicos y mensajes se consideran una parte necesaria de los Servicios y usted no puede evitarlos.", "privacy", "es");
t.add("communicating.1.3", "Le enviaremos correos electr\u00f3nicos sobre nuevos productos u otras noticias sobre AwardWallet que creamos que puedan ser de su inter\u00e9s bien de nosotros o de nuestros socios comerciales. Puede darse de baja de este tipo de mensajes en cualquier momento haciendo clic en el enlace para darse de baja que aparece en la parte inferior de cada comunicaci\u00f3n.", "privacy", "es");
t.add("communicating.1.4", "Ofrecer programas de recomendaci\u00f3n e incentivos, que le permiten utilizar enlaces de correo electr\u00f3nico, texto o URL que se pueden compartir con amigos o colegas.", "privacy", "es");
t.add("communicating.header", "Comunicaciones", "privacy", "es");
t.add("contents.header", "Contenidos:", "privacy", "es");
t.add("data_collection_info.1", "Recopilamos distintos tipos de informaci\u00f3n para prestarle nuestros servicios, como por ejemplo:", "privacy", "es");
t.add("data_collection_info.10", "Si le pedimos que proporcione informaci\u00f3n personal para cumplir con un requisito legal o para prestarle Servicios, se lo dejaremos claro en el momento adecuado y le informaremos si el suministro de su informaci\u00f3n personal es obligatorio o no (as\u00ed como de las posibles consecuencias en caso de que nos d\u00e9 su informaci\u00f3n personal).", "privacy", "es");
t.add("data_collection_info.11", "Del mismo modo, si recabamos y utilizamos sus datos personales en virtud de nuestros intereses leg\u00edtimos o los de un tercero y dichos intereses no figuran en la lista anterior, le aclararemos en el momento pertinente esos intereses leg\u00edtimos.", "privacy", "es");
t.add("data_collection_info.12", "Si tiene alguna pregunta o necesita m\u00e1s informaci\u00f3n sobre la base jur\u00eddica sobre la que recopilamos y utilizamos su informaci\u00f3n personal, %link_on%p\u00f3ngase en contacto con nosotros%link_off%.", "privacy", "es");
t.add("data_collection_info.2", "%bold_on%Cuenta de cliente y datos de registro:%bold_off% incluye la informaci\u00f3n que usted da para crear su cuenta con nosotros y puede incluir, nombre y apellidos, informaci\u00f3n del programa de recompensas de fidelidad de terceros (que incluye informaci\u00f3n de acceso a la cuenta), informaci\u00f3n de reserva de viajes, una contrase\u00f1a y una direcci\u00f3n de correo electr\u00f3nico v\u00e1lida.", "privacy", "es");
t.add("data_collection_info.3", "Datos de servicio (incluidos los datos de sesi\u00f3n y de uso):", "privacy", "es");
t.add("data_collection_info.4", "Cuando utiliza nuestros Servicios, recibimos informaci\u00f3n generada a trav\u00e9s del uso del Servicio, o de la propia infraestructura del Servicio, (por ejemplo, duraci\u00f3n de la sesi\u00f3n, informaci\u00f3n de conexi\u00f3n, etc.) Tambi\u00e9n podemos recopilar datos de uso y registro sobre c\u00f3mo se accede a los servicios y c\u00f3mo se utilizan, incluyendo informaci\u00f3n sobre el dispositivo en el que est\u00e1 utilizando los Servicios, direcciones IP, informaci\u00f3n de ubicaci\u00f3n, configuraci\u00f3n de idioma, qu\u00e9 sistema operativo est\u00e1 utilizando, identificadores \u00fanicos de dispositivo y otros datos de diagn\u00f3stico para ayudarnos a dar soporte a los Servicios. Consulte la Secci\u00f3n 3 \"An\u00e1lisis, cookies y otras tecnolog\u00edas del sitio web\" para obtener m\u00e1s informaci\u00f3n sobre los Datos del Servicio.", "privacy", "es");
t.add("data_collection_info.5", "%bold_on%Datos de terceros:%bold_off% Podemos recibir informaci\u00f3n sobre usted de otras fuentes, incluidos programas de recompensas o fidelizaci\u00f3n de terceros (a los que usted nos haya dado permiso para acceder), bases de datos de acceso p\u00fablico o terceros a los que hayamos comprado datos, y combinar estos datos con la informaci\u00f3n que ya tenemos sobre usted. Tambi\u00e9n podemos recibir informaci\u00f3n de otras empresas afiliadas que formen parte de nuestro grupo corporativo. Esto nos ayuda a actualizar, ampliar y analizar nuestros registros, identificar nuevas perspectivas de comercializaci\u00f3n y ofrecer productos y servicios que puedan ser de su inter\u00e9s.", "privacy", "es");
t.add("data_collection_info.6", "%bold_on%Informaci\u00f3n de localizaci\u00f3n:%bold_off% Recopilamos su informaci\u00f3n de ubicaci\u00f3n y su direcci\u00f3n IP con el fin de prestar y apoyar el servicio y a favor de la prevenci\u00f3n del fraude y ofrecer mayor seguridad.", "privacy", "es");
t.add("data_collection_info.7", "%bold_on%Informaci\u00f3n del dispositivo:%bold_off% Cuando utiliza nuestros Servicios, recopilamos autom\u00e1ticamente informaci\u00f3n sobre el tipo de dispositivo que utiliza, la versi\u00f3n del sistema operativo y el identificador \u00fanico del dispositivo (o \"UDID\").", "privacy", "es");
t.add("data_collection_info.8", "%bold_on%Base legal para el procesamiento (solo para residentes del EEE):%bold_off% Si usted pertenece al EEE, nuestra base legal para recopilar y utilizar la informaci\u00f3n personal descrita anteriormente depender\u00e1 de la informaci\u00f3n personal en cuesti\u00f3n y del contexto espec\u00edfico en el que la recopilemos. Si es usted vive en el EEE, \"informaci\u00f3n personal\" se define como cualquier informaci\u00f3n personal identificable u otros datos recogidos que puedan identificarle directa o indirectamente.", "privacy", "es");
t.add("data_collection_info.9", "Sin embargo, solo recopilaremos informaci\u00f3n personal suya cuando tengamos su consentimiento para hacerlo, cuando necesitemos la informaci\u00f3n personal para prestar los Servicios necesarios, o cuando el tratamiento sea en nuestro inter\u00e9s leg\u00edtimo y no prevalezca sobre sus intereses de protecci\u00f3n de datos o sus derechos y libertades fundamentales. En algunos casos, tambi\u00e9n podemos tener la obligaci\u00f3n legal de recopilar la informaci\u00f3n personal en cuesti\u00f3n.", "privacy", "es");
t.add("data_collection_info.header", "Datos que recopilamos y recibimos", "privacy", "es");
t.add("info_sharing.1", "Garantizar su privacidad es importante para nosotros, nos tomamos muy en serio nuestra responsabilidad de proteger sus datos personales. Seg\u00fan la ley, podemos compartir cierta informaci\u00f3n y datos de investigaci\u00f3n agregados con terceros, como se describe en esta Pol\u00edtica de Privacidad. Entre estos terceros se incluyen los siguientes:", "privacy", "es");
t.add("info_sharing.2", "%bold_on%Proveedores y proveedores de servicios de terceros.%bold_off% Utilizamos servicios de terceros que nos ayudan a llevar a cabo nuestras operaciones comerciales cotidianas, a continuaci\u00f3n se indican algunos ejemplos de dichas operaciones:", "privacy", "es");
t.add("info_sharing.2.1", "Hosting y prestaci\u00f3n de servicios AwardWallet", "privacy", "es");
t.add("info_sharing.2.2", "Atenci\u00f3n al cliente", "privacy", "es");
t.add("info_sharing.2.3", "Env\u00edo de correos electr\u00f3nicos", "privacy", "es");
t.add("info_sharing.2.4", "Almacenamiento, an\u00e1lisis y mantenimiento de datos", "privacy", "es");
t.add("info_sharing.2.5", "Infraestructura de computaci\u00f3n en la nube", "privacy", "es");
t.add("info_sharing.3", "Dichos terceros proveedores de servicios solo tienen acceso a la informaci\u00f3n personal en la medida necesaria para el desempe\u00f1o de sus funciones y deben tratar la informaci\u00f3n personal de conformidad con la presente Pol\u00edtica de Privacidad. Si transferimos parte de sus datos personales a un tercero que act\u00fae como agente, seremos responsables de cualquier acto de dichos terceros agentes que sea contrario a la presente Pol\u00edtica de Privacidad, salvo que la ley disponga lo contrario.", "privacy", "es");
t.add("info_sharing.4", "Utilizamos determinados socios de marketing y an\u00e1lisis, como Google Analytics, Facebook Analytics, Sparkpost, etc., para que nos ayuden a comercializar nuestros productos y a comprender c\u00f3mo utilizan nuestros usuarios nuestros servicios con el fin de mejorarlos. Estos terceros pueden recibir informaci\u00f3n sobre su uso de nuestros servicios y, potencialmente, informaci\u00f3n sobre sus visitas a otros servicios en l\u00ednea. Estos terceros solo est\u00e1n autorizados a utilizar su informaci\u00f3n para prestarnos sus servicios.", "privacy", "es");
t.add("info_sharing.5", "%bold_on%Socios publicitarios.%bold_off% Trabajamos con socios publicitarios que nos permiten personalizar el contenido publicitario que recibe en nuestros Servicios. Consulte la Secci\u00f3n 3 \"Tecnolog\u00edas de seguimiento\" para obtener m\u00e1s informaci\u00f3n sobre este tema.", "privacy", "es");
t.add("info_sharing.6", "%bold_on%Investigaciones de AwardWallet.%bold_off% Podemos compartir datos anonimizados y desidentificados (que no contienen ninguna informaci\u00f3n personal que pueda identificarle) con terceros. Por ejemplo, realizamos investigaciones utilizando datos agregados recopilados de nuestros usuarios para crear, utilizar y compartir determinados informes del sector, como el an\u00e1lisis del estado de un programa de fidelizaci\u00f3n o el an\u00e1lisis general de las tendencias de viajes. Los datos agregados no le identifican personalmente y no ser\u00e1n tratados como informaci\u00f3n personal en virtud de la presente Pol\u00edtica de Privacidad. Tambi\u00e9n podemos revelar sus datos personales a terceros, pero solo con su consentimiento previo. El uso que AwardWallet haga de la informaci\u00f3n recibida de las API de Google o de las API o Auth de Verizon Media se ajustar\u00e1 a la %link_on%Pol\u00edtica de datos de usuario de los servicios API de Google%link_off%, incluidos los requisitos de uso limitado y los requisitos de uso limitado de Verizon Media, respectivamente.", "privacy", "es");
t.add("info_sharing.7", "%bold_on%Cumplimiento legal.%bold_off% En determinados casos, AwardWallet puede verse obligado por ley a revelar sus datos personales. Por ejemplo, podemos divulgar sus datos para cumplir con una citaci\u00f3n judicial o cualquier otro proceso legal; cuando consideremos que su divulgaci\u00f3n es necesaria para proteger nuestros derechos, o para proteger su seguridad (o la seguridad de terceros); para investigar un fraude; para responder a una solicitud gubernamental; o para cumplir con solicitudes de seguridad nacional o de cumplimiento de la ley. Tambi\u00e9n podemos revelar su informaci\u00f3n a un tercero como parte de una fusi\u00f3n, venta de activos de la empresa, financiaci\u00f3n o adquisici\u00f3n de la totalidad o una parte de nuestra empresa por otra empresa en la que la informaci\u00f3n del cliente ser\u00e1 uno de los activos transferidos.", "privacy", "es");
t.add("info_sharing.header", "Compartir informaci\u00f3n", "privacy", "es");
t.add("info_usage_policy.1", "AwardWallet puede acceder (con su consentimiento, visualizaci\u00f3n o escucha limitada) y utilizar los datos que recopilamos seg\u00fan sea necesario (a) para prestar y mantener los Servicios; (b) para abordar y responder a problemas de servicio, seguridad y atenci\u00f3n al cliente; (c) para detectar, prevenir o abordar de otro modo problemas de fraude, seguridad, ilegales o t\u00e9cnicos; (d) seg\u00fan lo exija la ley; (e) para cumplir nuestros contratos; (f) para mejorar y ampliar los Servicios que damos; (g) para proporcionar an\u00e1lisis o informaci\u00f3n valiosa a nuestros clientes y usuarios.", "privacy", "es");
t.add("info_usage_policy.2", "Algunos ejemplos concretos de c\u00f3mo utilizamos la informaci\u00f3n:", "privacy", "es");
