t.add("info_usage_policy.2.4", "Enviarle actualizaciones de productos, comunicaciones de marketing e informaci\u00f3n sobre nuestros servicios", "privacy", "es");
t.add("info_usage_policy.2.5", "Responder a las consultas y solicitudes de los clientes", "privacy", "es");
