t.add("info_usage_policy.2.8", "Analizar datos, incluso mediante sistemas automatizados y aprendizaje autom\u00e1tico para mejorar nuestros servicios y\/o su experiencia", "privacy", "es");
t.add("info_usage_policy.2.9", "Proporcionarle informaci\u00f3n sobre el uso que hace de los servicios, as\u00ed como puntos de referencia, perspectivas y sugerencias para mejorar", "privacy", "es");
t.add("info_usage_policy.3", "AwardWallet conservar\u00e1 sus datos siempre que su cuenta siga activa, para cumplir con nuestras obligaciones legales, resolver disputas y hacer cumplir nuestros acuerdos.", "privacy", "es");
t.add("info_usage_policy.4", "Si desea cancelar su cuenta o que dejemos de prestarle servicios, o si tenemos informaci\u00f3n personal sobre usted y quiere que la eliminemos de nuestra base de datos o la inactivemos, puede hacerlo %link_on%here%link_off%.", "privacy", "es");
t.add("info_usage_policy.header", "C\u00f3mo utilizamos la informaci\u00f3n que recopilamos y recibimos", "privacy", "es");
t.add("intro.contact_info", "Si tiene alguna pregunta sobre esta pol\u00edtica de privacidad o nuestras pr\u00e1cticas, %link_on%p\u00f3ngase en contacto con nosotros%link_off%. Si vive en el Espacio Econ\u00f3mico Europeo (\"EEE\") y tiene alguna duda no resuelta sobre la privacidad o el uso de los datos que no hayamos resuelto satisfactoriamente, p\u00f3ngase en contacto con nuestro proveedor de resoluci\u00f3n de litigios con sede en Estados Unidos (de forma gratuita) en %link2_on%http:\/\/go.adr.org\/privacyshield.html%link2_off%.", "privacy", "es");
t.add("intro.header", "Presentaci\u00f3n", "privacy", "es");
t.add("intro.pp_info", "Esta Pol\u00edtica de privacidad le ayudar\u00e1 a comprender qu\u00e9 informaci\u00f3n recopilamos y utilizamos en AwardWallet, as\u00ed como las opciones que tienes asociadas a dicha informaci\u00f3n. Cuando nos referimos a \"AwardWallet\", \"nosotros\", \"nuestro\" o \"nos\" en esta pol\u00edtica, nos referimos a AwardWallet, LLC, entidad que ofrece los Servicios. Los \"Servicios\" hacen referencia a las aplicaciones, servicios y sitios web (marketing y producto) proporcionados por AwardWallet. AwardWallet puede, de vez en cuando, introducir nuevos productos y servicios. En la medida en que estos nuevos productos y servicios afecten a esta pol\u00edtica, te lo notificaremos tal y como se describe en la Secci\u00f3n 10 a continuaci\u00f3n. El uso de la informaci\u00f3n recopilada a trav\u00e9s de nuestro servicio se limitar\u00e1 a la finalidad de prestar los Servicios a nuestros clientes y seg\u00fan se especifica en el presente documento.", "privacy", "es");
t.add("other_questions", "Si tiene alguna otra pregunta sobre esta Pol\u00edtica de Privacidad, %link_on%p\u00f3ngase en contacto con nosotros%link_off%.", "privacy", "es");
t.add("privacy_shield_compliance.1", "AwardWallet cumple con el Marco del Escudo de la privacidad UE\/EE.UU. y el Marco del Escudo de la privacidad Suiza-EE.UU. establecidos por el Departamento de Comercio de EE.UU. en relaci\u00f3n con la recopilaci\u00f3n, el uso y la conservaci\u00f3n de la informaci\u00f3n personal transferida desde la Uni\u00f3n Europea y Suiza a Estados Unidos. AwardWallet ha certificado al Departamento de Comercio y este se adhiere a los Principios del Escudo de Privacidad. En caso de conflicto entre los t\u00e9rminos de esta Pol\u00edtica de privacidad y los Principios del Escudo de privacidad, prevalecer\u00e1n los Principios del Escudo de privacidad. Para obtener m\u00e1s informaci\u00f3n sobre el programa Escudo de privacidad consulte nuestra certificaci\u00f3n visitando %link_on%https:\/\/www.privacyshield.gov\/%link_off%.", "privacy", "es");
t.add("privacy_shield_compliance.header", "Cumplimiento del Escudo de la privacidad", "privacy", "es");
t.add("question_complaint.1", "En cumplimiento de los principios del Escudo de la privacidad, AwardWallet se compromete a resolver las reclamaciones sobre nuestra recopilaci\u00f3n o uso de tu informaci\u00f3n personal. Si reside en UE o Suiza y tiene preguntas o quejas sobre nuestra pol\u00edtica del Escudo de la privacidad debe %link_on%contactar primero con AwardWallet aqu\u00ed%link_off%.", "privacy", "es");
t.add("question_complaint.2", "AwardWallet se ha comprometido adem\u00e1s a remitir las reclamaciones no resueltas sobre el Escudo de la privacidad a la %link_on%American Arbitration Association%link_off%, un proveedor alternativo de resoluci\u00f3n de conflictos ubicado en Estados Unidos. En caso de que no reciba un acuse de recibo puntual de su reclamaci\u00f3n por nuestra parte, o si no hemos resuelto su reclamaci\u00f3n a su satisfacci\u00f3n, p\u00f3ngase en contacto con nosotros o vis\u00edtenos en %link2_on%https:\/\/go.adr.org\/privacyshield.html%link2_off% para obtener m\u00e1s informaci\u00f3n o presentar una reclamaci\u00f3n. Los servicios de la Asociaci\u00f3n Americana de Arbitraje son gratuitos.", "privacy", "es");
t.add("question_complaint.3", "En circunstancias limitadas, puede recurrir a un arbitraje vinculante para las reclamaciones no resueltas por los mecanismos anteriores. Encontrar\u00e1 m\u00e1s informaci\u00f3n en %link_on%https:\/\/www.privacyshield.gov\/article?id=ANNEX-I-introduction%link_off%.", "privacy", "es");
t.add("question_complaint.4", "AwardWallet est\u00e1 sujeta a los poderes de investigaci\u00f3n y ejecuci\u00f3n de la Comisi\u00f3n Federal de Comercio de EE.UU. en relaci\u00f3n con nuestro cumplimiento del Marco del Escudo de Privacidad UE-EE.UU. y el Marco del Escudo de Privacidad Suiza-EE.UU.", "privacy", "es");
t.add("question_complaint.header", "Preguntas o quejas", "privacy", "es");
t.add("security.1", "AwardWallet sigue las normas generalmente aceptadas para proteger la informaci\u00f3n personal que se nos env\u00eda, tanto durante la transmisi\u00f3n como una vez recibida, sin embargo, ninguna medida de seguridad es perfecta. Le recomendamos que proteja su contrase\u00f1a y que %link_on%use la autenticaci\u00f3n de dos factores en su cuenta%link_off%, ya que es una de las formas m\u00e1s sencillas de gestionar la seguridad de tu propia cuenta; recuerda que si pierde el control sobre su contrase\u00f1a, puede perder el control sobre su informaci\u00f3n personal.", "privacy", "es");
t.add("security.header", "Seguridad", "privacy", "es");
t.add("statement_changes.1", "Es posible que actualicemos esta Pol\u00edtica de Privacidad para reflejar cambios en nuestras pr\u00e1cticas de informaci\u00f3n. Si realizamos alg\u00fan cambio sustancial, se lo notificaremos en este sitio web, y es posible que se lo notifiquemos por correo electr\u00f3nico tambi\u00e9n (enviado a la direcci\u00f3n de correo electr\u00f3nico especificada en su cuenta), antes de que el cambio entre en vigor. Le recomendamos que revise peri\u00f3dicamente esta p\u00e1gina para obtener la informaci\u00f3n m\u00e1s reciente sobre nuestras pr\u00e1cticas de privacidad. Si sigue utilizando los Servicios despu\u00e9s de que dichos cambios entren en vigor, usted acepta la pol\u00edtica revisada.", "privacy", "es");
t.add("statement_changes.header", "Cambios en esta declaraci\u00f3n", "privacy", "es");
t.add("web_tech_terms.1", "AwardWallet mejora continuamente nuestros sitios web y productos mediante el uso de diversas herramientas de an\u00e1lisis web de terceros, que nos ayudan a comprender c\u00f3mo utilizan los visitantes nuestros sitios web, herramientas de escritorio y aplicaciones m\u00f3viles, qu\u00e9 les gusta y qu\u00e9 no, y d\u00f3nde pueden tener problemas.", "privacy", "es");
t.add("web_tech_terms.10", "Utilizamos software de an\u00e1lisis para m\u00f3viles que nos permite comprender mejor la funcionalidad de nuestro software para m\u00f3viles en su tel\u00e9fono. Este software puede registrar informaci\u00f3n como la frecuencia con la que utiliza la aplicaci\u00f3n, los eventos que se producen dentro de la aplicaci\u00f3n, el uso agregado, los datos de rendimiento y el lugar desde el que se descarg\u00f3 la aplicaci\u00f3n. No vinculamos la informaci\u00f3n que almacenamos dentro del software de an\u00e1lisis a ninguna informaci\u00f3n personal que le pueda identificar y que env\u00ede dentro de la aplicaci\u00f3n m\u00f3vil.", "privacy", "es");
t.add("web_tech_terms.11", "Redes sociales: Nuestros sitios incluyen algunas funciones de redes sociales, como unirse a nuestra p\u00e1gina en Facebook. Estas funciones pueden recopilar su direcci\u00f3n IP, la p\u00e1gina que est\u00e1 visitando en nuestro sitio y pueden establecer una cookie para permitir que la funci\u00f3n funcione correctamente. Estos servicios tambi\u00e9n autenticar\u00e1n su identidad y le ofrecer\u00e1n la opci\u00f3n de compartir cierta informaci\u00f3n personal con nosotros, como su nombre y direcci\u00f3n de correo electr\u00f3nico, para rellenar previamente nuestro formulario de registro o proporcionar comentarios. Sus interacciones con estas funciones se rigen por la pol\u00edtica de privacidad de la empresa que las proporciona.", "privacy", "es");
t.add("web_tech_terms.2", "Geolocalizaci\u00f3n y otros datos:", "privacy", "es");
t.add("web_tech_terms.3", "Podemos utilizar datos precisos de geolocalizaci\u00f3n, pero solo si usted acepta espec\u00edficamente la recopilaci\u00f3n de esos datos en relaci\u00f3n con un servicio concreto. Tambi\u00e9n utilizamos informaci\u00f3n como las direcciones IP para determinar las zonas geogr\u00e1ficas generales de nuestros visitantes. Las balizas web utilizadas junto con estas herramientas de an\u00e1lisis web pueden recopilar datos como qu\u00e9 navegador o sistema operativo utiliza una persona, as\u00ed como nombres de dominio, tipos MIME y qu\u00e9 contenidos, productos y servicios se revisan o descargan al visitar o registrarse en los servicios de uno de nuestros sitios web o utilizar una de nuestras aplicaciones m\u00f3viles.", "privacy", "es");
t.add("web_tech_terms.4", "Google Analytics y Adobe Marketing Cloud:", "privacy", "es");
t.add("web_tech_terms.5", "Utilizamos Google Analytics tal y como se describe en %link_on%\"C\u00f3mo utiliza Google los datos cuando usted utiliza los sitios o aplicaciones de nuestros socios\"%link_off% Puede evitar que Google Analytics utilice sus datos en sitios web instalando el complemento de inhabilitaci\u00f3n para navegadores de Google Analytics %link2_on%here%link2_off%. Tambi\u00e9n usamos el enmascaramiento de direcciones IP, una t\u00e9cnica utilizada para truncar las direcciones IP recopiladas por %link3_on%Google Analytics%link3_off% y almacenarlas de forma abreviada para evitar que se puedan rastrear hasta usuarios individuales.", "privacy", "es");
t.add("web_tech_terms.6", "Tecnolog\u00edas de seguimiento:", "privacy", "es");
t.add("web_tech_terms.7", "AwardWallet y nuestros socios utilizan cookies y tecnolog\u00edas de seguimiento similares para realizar un seguimiento del tr\u00e1fico de los usuarios y conservar determinada informaci\u00f3n de registro. Las tecnolog\u00edas de rastreo que tambi\u00e9n se utilizan son balizas, etiquetas y secuencias de comandos para recopilar y rastrear informaci\u00f3n y para mejorar y analizar nuestro servicio. Si no desea que la informaci\u00f3n recopilada por estas tecnolog\u00edas se utilice para ofrecerle anuncios personalizados, puede desactivar esta opci\u00f3n en el perfil de su cuenta. El men\u00fa Ayuda de la barra de men\u00fas de la mayor\u00eda de los navegadores le indicar\u00e1 c\u00f3mo impedir que su navegador acepte nuevas cookies, c\u00f3mo hacer que el navegador le notifique cuando reciba una nueva cookie y c\u00f3mo desactivar las cookies por completo. Puede seguir visitando el sitio web si decide configurar su navegador para que rechace todas las cookies; sin embargo, debe habilitar las cookies para crear una cuenta e instalar los Servicios.", "privacy", "es");
t.add("web_tech_terms.8", "Ejemplos de las cookies que usamos:", "privacy", "es");
t.add("web_tech_terms.8.1.label", "Tipo de cookie", "privacy", "es");
