t.add("web_tech_terms.8.1.value.13", "Algunas cookies son esenciales para el funcionamiento de los sitios web de AwardWallet. Si un usuario decide desactivar estas cookies, no podr\u00e1 acceder a todos los contenidos y funciones.", "privacy", "es");
t.add("web_tech_terms.8.1.value.21", "Cookies de preferencias", "privacy", "es");
t.add("web_tech_terms.8.1.value.22", "Utilizamos estas cookies para recordar sus preferencias.", "privacy", "es");
t.add("web_tech_terms.8.1.value.23", "Cuando te registras en un sitio web de AwardWallet, utilizamos cookies para almacenar identificadores de usuario \u00fanicos y asignados aleatoriamente que generamos con fines administrativos. Estas cookies te permiten entrar en los sitios web de AwardWallet sin tener que iniciar sesi\u00f3n cada vez.", "privacy", "es");
