t.add("web_tech_terms.8.1.value.32", "Estas cookies se utilizan para ofrecerle anuncios que puedan ser relevantes para usted y sus intereses.", "privacy", "es");
t.add("web_tech_terms.8.1.value.33", "Utilizamos cookies para que la publicidad resulte m\u00e1s atractiva para los usuarios, as\u00ed como para ayudar a elaborar informes sobre el rendimiento y los an\u00e1lisis de los programas de marketing.", "privacy", "es");
t.add("web_tech_terms.8.1.value.41", "Cookies de seguridad", "privacy", "es");
t.add("web_tech_terms.8.1.value.42", "Estas cookies se utilizan con fines generales de seguridad y autenticaci\u00f3n de usuarios.", "privacy", "es");
t.add("web_tech_terms.8.1.value.43", "Utilizamos cookies de seguridad para autenticar a los usuarios, evitar el uso fraudulento de las credenciales de inicio de sesi\u00f3n y proteger los datos de los usuarios frente al acceso de terceros no autorizados.", "privacy", "es");
